import Textfield from '../components/';

export default class Login extends Component {
    render() {
        return (
            <div class="center Glass-plate login">
                <Textfield name="email" icon="https://img.icons8.com/color/50/000000/email.png" cont="email" />
            </div>
        );
    }
}
